import React, { Component } from 'react';
import HomeFooter from './HomeFooter.js';
import CovidWorld from './CovidWorld';
import CovidSE from './CovidSE';
import News from './News';
import './home.css';

import { Tabs, Tab, tabList } from 'react-bootstrap';

class HomePage extends Component {
  render() {
    return (
      <div className="bg-light">
        <Tabs
          variant="pills"
          className="pt-3 pb-3 justify-content-center "
          defaultActiveKey="covidSE"
          id="uncontrolled-tab-example"
        >
          <tabList>
            <Tab className="tab" eventKey="covidSE" title="Sweden">
              <CovidSE />
            </Tab>
            <Tab eventKey="covidWorld" title="World">
              <CovidWorld />
            </Tab>
            <Tab eventKey="news" title="News">
              <News />
            </Tab>
          </tabList>
        </Tabs>
      </div>
    );
  }
}

export default HomePage;
